import {ABOUT, CONTACT, HOME_PAGE, LOGIN_PAGE, SIGNUP_PAGE} from "../util/config";

export default function Navbar(props) {

    const additionalClasses = "text-[#A259FF]"

    function setPage(property) {
        props.setPage(property)
    }

    return (
        <div className="p-6 flex justify-around">

            {/*logo and text*/}
            <div className="flex items-center">
                <img className="" width="24px" src="https://img.icons8.com/material-rounded/48/A259FF/cyber-security.png" alt=""/>
                <p className="text-xl text-white ml-2 font-['Space_Mono']">Graphical Password Auth</p>
            </div>

            {/*nav element*/}
            <div className="font-['Work_Sans'] text-white flex items-center">
                <p className={`text-xl cursor-pointer ${props.currentPage === HOME_PAGE ? additionalClasses : ""}`} onClick={() => setPage(HOME_PAGE)}>Home</p>
                <p className={`text-xl ml-12 ${props.currentPage === ABOUT ? additionalClasses : ""}`}>About Us</p>
                <p className={`text-xl ml-12 mr-20 ${props.currentPage === CONTACT ? additionalClasses : ""}`}>Contact</p>
                <button onClick={() => setPage(LOGIN_PAGE)} className="transition duration-500 ease-in-out bg-[#A259FF] rounded-lg px-4 py-1 ml-12 border-[#A259FF] border-2 hover:bg-transparent">Login</button>
                <button onClick={() => setPage(SIGNUP_PAGE)} className="transition duration-500 ease-in-out bg-[#A259FF] rounded-lg px-4 py-1 ml-6 border-[#A259FF] border-2 hover:bg-transparent">Sign Up</button>
            </div>
        </div>
    )
}
